export default () => ({
  groupedExtrasLists: {
    width: '100%',
    margin: '0',
    paddingLeft: '0',
  },

  groupedExtrasListItem: {
    paddingLeft: '0px !important',
    paddingRight: '0px !important',
  },

  extrasListName: {
    width: '50%',
  },

  multiselectionCheckbox: {
    width: '40%',
  },

  extrasList: {
    width: '100%',
    paddingLeft: '1rem',
  },

  deleteIconWrapper: {
    width: '10%',
  },

  addExtraBtn: {
    textTransform: 'none',
  },
});
